import React, { useEffect, useState } from 'react'
import packageimg from '../../Assets/agrap2.jpg';
import './Package.css'
import {
    MDBCard,
    MDBCardImage,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBRow,
    MDBCol
  } from 'mdb-react-ui-kit';

const Package = () => {
    const [packages,setPackage]=useState([])
    useEffect(() => {
        // Fetch carousel data using axios and update the state
        const fetchCarouselData = async () => {
            try {
                const response = await axios.get('https://localhost:7026/UserSide/DisplayingAllLocations');
                console.log(response.data);
                setPackage(response.data); // Assuming the API response contains the data for carousel items
            } catch (error) {
                console.error(error);
            }
        };

        fetchCarouselData();
    }, []);
    return (
        <>
            <div>
                <div>
                    <img src={packageimg} className='gallery-img' />
                </div>
                <div className='package-head'>PACKAGES</div>

            </div>
            <div className='filter-by'>
                <div>
                    filter by
                </div>
            </div>
            <div className='container'>
                <br></br><br></br><br></br><br></br><br /><br />
                <div>
                    <h3>Best Offered Packages</h3>
                </div>
                <div>
                    <MDBRow className='row-cols-1 row-cols-md-3 g-4'>
                        <MDBCol>
                            <MDBCard className='h-100'>
                                <MDBCardImage
                                    src={packageimg}
                                    alt='...'
                                    position='top'
                                    className='card-image'
                                />
                                <MDBCardBody>
                                    <MDBCardTitle>Package</MDBCardTitle>
                                    <MDBCardText>
                                        This is a longer card with supporting text below as a natural lead-in to additional content.
                                        This content is a little bit longer.
                                    </MDBCardText>
                                </MDBCardBody>
                            </MDBCard>
                        </MDBCol>
                    </MDBRow>
                    <br></br><br></br><br></br><br></br>
                </div>
            </div>
        </>

    )
}

export default Package
